export default class Descriptions {
  public static ABOUT_ME =
    "My name is Lorenzo. I am a software developer (degree says engineer, but I'm not so sure about that) " +
    "with a love for all things frontend. I tend to gravitate towards the more outwardly creative corners " +
    "of software because I believe myself to naturally be more creative minded than technical. Before I decided " +
    "to try my hand in software engineering at Iowa State Univerity, I originally planned on futher pursuing " +
    "my love of music in college but thought it would be benefically to add to my skillset, and so I find myself " +
    "";
  public static HOBBIES = "";
}
